import React from 'react'
import './Home.css'
import Product from './Product'



function Home() {
    return (
        <div>
            <div className="home">
                <div className="home__container">

                    <img src="https://dl6lnggp44pnu.cloudfront.net/service-multimedia/330004908-photo-5460" alt="" className="home__image" width="100%" />

                    <div className="home__row">
                        <Product
                            key = {Math.random() * 100}
                            title="Product title 1"
                            price={30}
                            rating={5}
                            image='https://ng.jumia.is/unsafe/fit-in/680x680/filters:fill(white)/product/36/295128/1.jpg?3524'


                        />
                        <Product
                            key='123456'
                            title="Product title 2"
                            price={30.5}
                            rating={3}
                            image='https://ng.jumia.is/unsafe/fit-in/680x680/filters:fill(white)/product/36/295128/1.jpg?3524'

                        />
                    </div>
                    <div className="home__row">
                        <Product
                            key='123457'
                            title="Product title 3"
                            price={34}
                            rating={5}
                            image='https://ng.jumia.is/unsafe/fit-in/680x680/filters:fill(white)/product/36/295128/1.jpg?3524' />
                        <Product
                            key='123458'
                            title="Product title 4"
                            price={30}
                            rating={5}
                            image='https://ng.jumia.is/unsafe/fit-in/680x680/filters:fill(white)/product/36/295128/1.jpg?3524' />
                        <Product
                            key='123459'
                            title="Product title 5"
                            price={30}
                            rating={5}
                            image='https://ng.jumia.is/unsafe/fit-in/680x680/filters:fill(white)/product/36/295128/1.jpg?3524' />
                    </div>
                    <div className="home__row">

                        <Product key='123459'
                            title="Product title 5"
                            price={78}
                            rating={4}
                            image='https://ng.jumia.is/unsafe/fit-in/680x680/filters:fill(white)/product/36/295128/1.jpg?3524' />
                        <Product key='123459'
                            title="Product title 6"
                            price={45}
                            rating={5}
                            image='https://ng.jumia.is/unsafe/fit-in/680x680/filters:fill(white)/product/36/295128/1.jpg?3524' />

                    </div>
                </div>


            </div>



       </div>

    )
}

export default Home
